import React from "react"; 
import {Card} from "react-bootstrap";
import CardFront from "./front.png"

const Front = (props) => {

    return(
        <div className = "">        
        <Container>{props.CardFront}
        <Image src = {CardFront}fluid> 
        </Image> 
        </Container></div>

    )
}

export default Front;
